import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [file, setFile] = useState(null);
  const [status, setStatus] = useState('Idle');
  const [assetID, setAssetID] = useState('');
  const apiToken = 'eyJhbGciOiJSUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICJuSnVpYzVwbXk1T1hGSjVmY1RIQTdUNVktRHZVbVVOR2xxVHBqS0hDVnU4In0..H1HFLueZM-jehJbuwKJ8HdMAUAILY5Ao5J5OyrK3ITE58l5d2JccK21KHy4NL-CZOvqqSxMvd0d_M7UFb4UU_sqKi25BP_nHHViXUxeCjFPTJJTVVwWTLB0b2yLsvEalEIhWXVcV4wPFCP0UqGk6Ud35bFlSzPkQmtwStLLZGq0cFCZoihf8-FZ6UMFWxF8s8eZ8Ub-WzCoiQn_8UBQqdC50LeiSpjwflIwj5GYpickLIUPS0bNC0jopq9Tpahlf0QuIhHXzNLjOot745KMCBYTaqiyhimjiZQ2YTksk_G1c8WLUO9KafnUmLAltThs0GKWFsMtVmDSGDH0m_w918w'; // Replace with your actual API token

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const createAvatar = async () => {
    setStatus('Creating Avatar...');
    try {
      const response = await axios.post('https://api.meshcapade.com/api/v1/avatars/create/from-images', {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      console.log(response); // Log the full response object
      const newAssetID = response.data.data.id;
      if (newAssetID) {
        setAssetID(newAssetID);
        setStatus('Avatar Created');
        return newAssetID;
      } else {
        throw new Error('Invalid cheese structure');
      }
    } catch (error) {
      console.error('Error creating avatar:', error);
      setStatus(`Error Creating Avatar: ${error.message}`);
      return null;
    }
  };


  const uploadImage = async (assetID) => {
    if (!assetID) return;
    setStatus('Uploading Image...');
    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/images/upload`, formData, {
        headers: {
          'Authorization': `Bearer ${apiToken}`,
          'Content-Type': 'multipart/form-data',
        },
      });
      if (response.status === 200) {
        setStatus('Image Uploaded');
        return true;
      } else {
        throw new Error('Image upload failed');
      }
    } catch (error) {
      console.error('Error uploading image:', error.response || error);
      setStatus(`Error Uploading Image: ${error.response?.statusText || error.message}`);
    }

  };

  const startFittingProcess = async (assetID) => {
    if (!assetID) return;
    setStatus('Starting Fitting Process...');
    try {
      const response = await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/fit-to-images`, {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      if (response.status === 200) {
        setStatus('Fitting Process Started');
      } else {
        throw new Error('Fitting process initiation failed');
      }
    } catch (error) {
      console.error('Error starting fitting process:', error);
      setStatus(`Error Starting Fitting Process: ${error.message}`);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!file) {
      alert('Please select a file.');
      return;
    }

    const createdAssetID = await createAvatar();
    if (createdAssetID) {
      const imageUploaded = await uploadImage(createdAssetID);
      if (imageUploaded) {
        await startFittingProcess(createdAssetID);
      }
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit">Upload and Create Avatar</button>
      </form>
      <div>Status: {status}</div>
      {assetID && <div>Asset ID: {assetID}</div>}
    </div>
  );
}

export default App;
